"use client";

import React, { useState } from "react";
import { Sidebar, SidebarBody, SidebarButton, SidebarLink } from "./ui/sidebar";
import {
  IconArrowLeft,
  IconBrandTabler,
  IconHome,
  IconSettings,
  IconUserBolt,
} from "@tabler/icons-react";
import Link from "next/link";
import { motion } from "framer-motion";
import Image from "next/image";
import { cn } from "@/lib/utils";
import { UserType } from "@/@types/user";
import { Divider } from "./ui/divider";
import { usePathname } from "next/navigation";
import { Table, Users } from "lucide-react";
import { SignOut } from "@/actions/sign-out";

export function SidebarPlataform({
  children,
  user,
}: {
  children: React.ReactNode;
  user: UserType;
}) {
  const pathname = usePathname();

  const isProject = pathname.includes("/plataforma/projetos/");

  const projectId = pathname.split("/plataforma/projetos/")[1]?.split("/")[0];

  const links = [
    {
      label: "Início",
      href: "/plataforma",
      icon: (
        <IconHome className="h-5 w-5 flex-shrink-0 text-neutral-700 dark:text-neutral-200" />
      ),
    },
  ];

  const linksProject = [
    {
      label: "Dashboard",
      href: `/plataforma/projetos/${projectId}`,
      icon: (
        <Table className="h-5 w-5 flex-shrink-0 text-neutral-700 dark:text-neutral-200" />
      ),
    },
    {
      label: "Residentes",
      href: `/plataforma/projetos/${projectId}/residentes`,
      icon: (
        <Users className="h-5 w-5 flex-shrink-0 text-neutral-700 dark:text-neutral-200" />
      ),
    },
  ];
  const [open, setOpen] = useState(false);

  async function handleSignOut() {
    await SignOut();
  }

  return (
    <div className="relative isolate flex min-h-svh w-full flex-col rounded-md border border-neutral-200 bg-gray-100 dark:border-neutral-700 dark:bg-neutral-800 md:flex-row">
      <div className="md:sticky md:inset-y-0 md:left-0 md:h-screen">
        <Sidebar open={open} setOpen={setOpen}>
          <SidebarBody className="justify-between gap-10">
            <div className="flex flex-1 flex-col overflow-y-auto overflow-x-hidden">
              <>
                <Logo />
              </>
              <div className="mt-8 flex flex-col gap-2">
                {links.map((link, idx) => (
                  <SidebarLink key={idx} link={link} />
                ))}
              </div>

              {isProject && (
                <>
                  <Divider className="my-5" />
                  <div className="flex flex-col gap-2">
                    {linksProject.map((link, idx) => (
                      <SidebarLink key={idx} link={link} />
                    ))}
                  </div>
                </>
              )}
            </div>
            <div>
              {user.role === "admin" && (
                <div className="mb-4 flex flex-col gap-2">
                  <SidebarLink
                    link={{
                      label: "Configurações",
                      href: "/plataforma/configuracoes",
                      icon: (
                        <IconSettings className="h-5 w-5 flex-shrink-0 text-neutral-700 dark:text-neutral-200" />
                      ),
                    }}
                  />
                </div>
              )}
              <button onClick={handleSignOut}>
                <SidebarLink
                  className="mb-4"
                  link={{
                    label: "Sair",
                    href: "#",
                    icon: (
                      <IconArrowLeft className="h-5 w-5 flex-shrink-0 text-neutral-700 dark:text-neutral-200" />
                    ),
                  }}
                />
              </button>
              <SidebarLink
                link={{
                  label: user.name,
                  href: "/plataforma/perfil",
                  icon: user.avatar ? (
                    <Image
                      src={user.avatar}
                      className="h-7 w-7 flex-shrink-0 rounded-full"
                      width={50}
                      height={50}
                      alt="Avatar"
                    />
                  ) : (
                    <div className="h-7 w-7 flex-shrink-0 rounded-full border border-neutral-200">
                      <p className="text-center text-neutral-700 dark:text-neutral-200">
                        {user.name.charAt(0) + user.name.charAt(1)}
                      </p>
                    </div>
                  ),
                }}
              />
            </div>
          </SidebarBody>
        </Sidebar>
      </div>

      <div className="w-full flex-1 grow border border-neutral-200 bg-white p-6 dark:border-neutral-700 dark:bg-neutral-900 md:rounded-bl-2xl md:rounded-tl-2xl md:p-10 lg:p-10 lg:shadow-sm">
        <div className="mx-auto max-w-6xl">{children}</div>
      </div>
    </div>
  );
}
